window.onload = async function () {
    const memberTag = document.getElementById('hello-h3');
    // 發送 GET 請求用戶數據
    const response = await axios.get('/getUserProfiles');
    const member = response.data;
    memberid = member.memberid;
    username = member.username;
    password = member.password;
    nickname = member.nickname;
    avatar = member.avatar;
    birthday = member.birthday;
    signature = member.signature;
    phone = member.phone;

    if (memberid != null) {
    } else {
        // 導向登入頁面
        window.location.href = "/login";
    }
//預設頭像，填入會員資料
    if (avatar == null || avatar === '') {
        avatar = 'data:image/png;base64,';
    }
    document.getElementById('avatar').src = avatar;
    document.getElementById('username').textContent = username;
    document.getElementById('nickname').textContent = nickname;
    document.getElementById('birthday').textContent = birthday;
    document.getElementById('phone').textContent = phone;
    document.getElementById('password').textContent = password.substring(0,35)+' ... ...';

    //顯示CkEditor
    ShowCkEditor();
// 顯示會員名稱
memberTag.textContent = `您好,${nickname}！`;
}

async function changeNickname() {
    let nickname;
    let response;

    const { value } = await Swal.fire({
        title: "修改暱稱",
        input: "text",
        inputLabel: "請輸入您的新暱稱",
        showCancelButton: true,
        inputValidator: (value) => {
            if (!value) {
                return "您需要輸入暱稱!";
            }
        }
    });
    if (value) {
        nickname = value;
        // 發送 PUT 請求修改暱稱
        response = await axios.put(`/api/members/${memberid}`, { nickname });
        if (response.status >= 200 && response.status < 300) {
            Swal.fire("修改暱稱成功!").then(result => {
                if (result.isConfirmed) {
                     window.location.reload();
                }
            });
        } else {
            Swal.fire("修改暱稱失敗!");
        }
    }
}
// 修改電話
async function changePhone() {
    let phone;
    let response;

    const { value } = await Swal.fire({
        title: "修改電話",
        input: "text",
        inputLabel: "請輸入您的電話號碼",
        showCancelButton: true,
        inputValidator: (value) => {
            if (!value) {
                return "您需要輸入電話號碼!";
            }
            if (!/\d{10}/.test(value)) {
                return "電話號碼格式不正確!";
            }
        }
    });
    if (value) {
        phone = value;
        // 發送 PUT 請求修改電話號碼
        response = await axios.put(`/api/members/${memberid}`, { phone });
        if (response.status >= 200 && response.status < 300) {
            Swal.fire("修改電話號碼成功!").then(result => {
                if (result.isConfirmed) {
                    window.location.reload();
                }
            });
        } else {
            Swal.fire("修改電話號碼失敗!");
        }
    }
}

// 修改生日
async function changeBirthday() {
    let birthday;
    let response;

    const { value :date } = await Swal.fire({
        title: "選擇您的生日",
        input: "date",
        didOpen: () => {
            // 設置預設日期為2012/01/01
            Swal.getInput().value = "2012-01-01";
            // 設置日期的範圍限制在1920/01/01年到2020/01/01
            Swal.getInput().min = "1920-01-01";
            Swal.getInput().max = "2020-01-01";
        }
    });
    if (date) {
        Swal.fire({
            title: "生日",
            text: date,
            showCancelButton: true
        }).then(async result => {
            if (result.isConfirmed) {
                birthday = date.toString();
                // 發送 PUT 請求修改生日
                response = await axios.put(`/api/members/${memberid}`, {birthday});
                if (response.status >= 200 && response.status < 300) {
                    Swal.fire("修改生日成功!").then(result => {
                        if (result.isConfirmed) {
                            window.location.reload();
                        }
                    });
                } else {
                    Swal.fire("修改生日失敗!");
                }
            }
        });
    }
}
// 上傳頭像
function ShowUpload() {
    // 獲取输入框元素
    const uploadInput = document.getElementById('avatar-upload-input');

    // 切換顯示狀態
    if (uploadInput.style.display === 'none') {
        uploadInput.style.display = 'block';
    } else {
        uploadInput.style.display = 'none';
    }
};

document.getElementById('avatar-upload-input').addEventListener('change', function() {
        // 創建 FileReader 對象
        const reader = new FileReader();
            // 檢查檔案大小
            const maxSize = 10 * 1024 * 1024; // 10MB
            const fileSize = this.files[0].size;

            if (fileSize > maxSize) {
                document.getElementById('fileSizeError').innerText = '檔案大小超過限制（最大10MB）';
                input.value = ''; // 清空檔案選擇，避免上傳超大檔案
            } else {
                document.getElementById('fileSizeError').innerText = ' ';
            }
        // 設置讀取完成後的回調函數
        reader.onload = async function (result) {

            const avatar = result.target.result;
            // 發送 POST 请求
            response = await axios.put(`/api/members/${memberid}`, {avatar});
            Swal.fire({
                title: '傳送中...請稍後',
                icon: 'info',
                allowOutsideClick: false, // 防止用戶點擊外部關閉彈窗
                showConfirmButton: false, // 不顯示確認按鈕
                timerProgressBar: true, // 顯示定時器進度條
            });
            if (response.status >= 200 && response.status < 300) {
                Swal.fire("修改頭像成功!").then(result => {
                    if (result.isConfirmed) {
                        window.location.reload();
                    }
                });
            } else {
                Swal.fire("修改頭像失敗!請檢查上傳檔案。");
            }
        };
        // 讀取文件
         reader.readAsDataURL(this.files[0]);
        });

